import{_ as e,a as r,b as l}from"./chunks/fun_cub_aluminium_frame_for_vtol_mounted.BkZ4sGk0.js";import{_ as o}from"./chunks/px4_frame_generic_standard_vtol.ArpkwYLu.js";import{_ as i,c as d,o as n,ab as u,m as t,a}from"./chunks/framework.CUflZczI.js";const T=JSON.parse('{"title":"FunCub QuadPlane (Pixhawk)","description":"","frontmatter":{},"headers":[],"relativePath":"uk/frames_vtol/vtol_quadplane_fun_cub_vtol_pixhawk.md","filePath":"uk/frames_vtol/vtol_quadplane_fun_cub_vtol_pixhawk.md"}'),s={name:"uk/frames_vtol/vtol_quadplane_fun_cub_vtol_pixhawk.md"},_=u('<h1 id="funcub-quadplane-pixhawk" tabindex="-1">FunCub QuadPlane (Pixhawk) <a class="header-anchor" href="#funcub-quadplane-pixhawk" aria-label="Permalink to &quot;FunCub QuadPlane (Pixhawk)&quot;">​</a></h1><p>QuadPlane VTOL Fun Cub є стандартним повітряним судном з хвостовим оперенням (Multiplex FunCub), яке було модернізовано з системою QuadCopter.</p><p>Основна Інформація:</p><ul><li><strong>Каркас:</strong> Multiplex FunCub</li><li><strong>Контролер польоту:</strong> Pixhawk</li></ul><p><img src="'+e+'" alt="Fun Cub VTOL"></p><p>Без змін, Fun Cub - це відносно доступний літак і відносно легкий у польоті. Після конвертації літак стає значно важчим і менш аеродинамічним. Він все ще досить добре літає, але потребує близько 75% газу у польоті вперед.</p><h2 id="специфікація-матеріалів" tabindex="-1">Специфікація матеріалів <a class="header-anchor" href="#специфікація-матеріалів" aria-label="Permalink to &quot;Специфікація матеріалів&quot;">​</a></h2><p>Справжній літак приблизно виглядає так, як показано на зображенні вище (інші схожі моделі також підійдуть добре - це Multiplex Fun Cub).</p><p>Мінімально необхідне обладнання:</p><ul><li>Multiplex FunCub (або подібний)</li><li>Pixhawk або сумісний</li><li>Цифровий датчик швидкості польоту</li><li>900 кВ двигуни (наприклад, комплект пропульсії Iris - двигуни та регулятори швидкості)</li><li>10&quot; пропелери для квадрокоптерів (10х45 або 10х47)</li><li>10&quot; гвинт для мотора фіксованого крила (10×7)</li><li>Модуль GPS</li><li>Батарея 4S</li><li>Алюмінієва рама для кріплення двигунів квадрокоптера (квадратна труба 10х10 мм, стінка 1 мм)</li><li>TOW важить ~2.3кг з батареєю 4S на 4200mAh</li></ul><h2 id="структура" tabindex="-1">Структура <a class="header-anchor" href="#структура" aria-label="Permalink to &quot;Структура&quot;">​</a></h2><p>Структура виготовлена з алюмінієвих стрижнів, як показано нижче.</p><p><img src="'+r+'" alt="quad_frame"> <img src="'+l+'" alt="Fun Cub -frame for vtol mounted"></p><h2 id="підключення" tabindex="-1">Підключення <a class="header-anchor" href="#підключення" aria-label="Permalink to &quot;Підключення&quot;">​</a></h2><p>Проводка двигуна та сервоприводу практично взагалі залежить від вас, але повинна відповідати конфігурації <a href="./../airframes/airframe_reference.html#vtol_standard_vtol_generic_standard_vtol">Загального стандартного VTOL</a>, як показано в посиланні на конструкцію корпусу. Геометрія та призначення виводу можуть бути налаштовані в <a href="./../config/actuators.html#actuator-outputs">Конфігурації приводів</a></p><p>Наприклад, ви можете з’єднати його так, як у цьому прикладі (орієнтація як у &quot;сидячи в літаку&quot;):</p><table><thead><tr><th>Порт</th><th>Підключення</th></tr></thead><tbody><tr><td>MAIN 1</td><td>Передній правий мотор (CCW)</td></tr><tr><td>MAIN 2</td><td>Задній лівий мотор (CCW)</td></tr><tr><td>MAIN 3</td><td>Передній лівий мотор (CW)</td></tr><tr><td>MAIN 4</td><td>Правий задній мотор (CW)</td></tr><tr><td>AUX 1</td><td>Лівий елерон TODO</td></tr><tr><td>AUX 2</td><td>Правий елерон</td></tr><tr><td>AUX 3</td><td>Elevator</td></tr><tr><td>AUX 4</td><td>Rudder</td></tr><tr><td>AUX 5</td><td>Тяга</td></tr></tbody></table><p>Для подальших інструкцій щодо проводки та конфігурацій дивіться: <a href="./../config_vtol/vtol_quad_configuration.html">Стандартна Проводка та Налаштування VTOL</a>. </p><h2 id="конфігурація-планера" tabindex="-1">Конфігурація планера <a class="header-anchor" href="#конфігурація-планера" aria-label="Permalink to &quot;Конфігурація планера&quot;">​</a></h2><ol><li><p>Для <a href="./../config/airframe.html">планера</a> виберіть групу/тип транспортного засобу як <em>Standard VTOL</em> та конкретний транспортний засіб як <a href="./../airframes/airframe_reference.html#vtol_standard_vtol_generic_standard_vtol">Generic Standard VTOL</a>, як показано нижче (не забудьте натиснути <strong>Застосувати та перезапустити</strong> зверху).</p><p><img src="'+o+'" alt="QCG - Select Generic Standard VTOL"></p></li><li><p>Налаштуйте виводи та геометрію, дотримуючись інструкцій у <a href="./../config/actuators.html">Налаштування приводів</a></p></li><li><p>За замовчуванням параметри часто достатні для стабільного польоту. Для отримання докладнішої інформації з настройки дивіться <a href="./../config_vtol/vtol_quad_configuration.html">Стандартна Проводка та Налаштування VTOL</a>.</p></li></ol><p>Після завершення калібрування, VTOL готовий до польоту.</p><h2 id="відео" tabindex="-1">Відео <a class="header-anchor" href="#відео" aria-label="Permalink to &quot;Відео&quot;">​</a></h2>',22),h=t("p",null,[t("div",{class:"embed-responsive embed-responsive-16by9"},[t("iframe",{class:"embed-responsive-item youtube-player",type:"text/html",width:"640",height:"390",src:"https://www.youtube.com/embed/4K8yaa6A0ks",frameborder:"0",webkitallowfullscreen:"",mozallowfullscreen:"",allowfullscreen:""})])],-1),p=t("h2",{id:"підтримка",tabindex:"-1"},[a("Підтримка "),t("a",{class:"header-anchor",href:"#підтримка","aria-label":'Permalink to "Підтримка"'},"​")],-1),c=t("p",null,[a("Якщо у вас виникли запитання щодо перетворення або конфігурації VTOL, зайдіть на "),t("a",{href:"https://discuss.px4.io/c/px4/vtol",target:"_blank",rel:"noreferrer"},"https://discuss.px4.io/c/px4/vtol"),a(".")],-1),m=[_,h,p,c];function f(b,v,x,k,q,g){return n(),d("div",null,m)}const V=i(s,[["render",f]]);export{T as __pageData,V as default};
